        <div className='card-container'>
            <div className='image-container'>
            <img src={ imageUrl } alt='' />
            </div>

        <div ClassName='card-title'>
            <h3>{title}</h3>
        </div>

        <div ClassName='card-body'>
            <></>{body}
        </div>

        </div>


    )
}

export default Card
